// src/components/Tarjeta.js
import React from "react";
import "./Tarjeta.css";

function Tarjeta({ palabraSue, palabraEsp }) {
  return (
    <div className="tarjeta">
      <p className="palabra-sueco">{palabraSue}</p>
      <p className="palabra-espanol">{palabraEsp}</p>
    </div>
  );
}

export default Tarjeta;
